try:
    import pickle, base64
    bytes = b""
    obj = pickle.loads(base64.b64decode(bytes))
    _compile_error = None
except Exception as e:
    _compile_error = e

def wrapper(CRIM, ZN, INDUS, CHAS, NOX, RM, AGE, DIS, RAD, TAX, PTRATIO, B, LSTAT):
    "Output: var1, msg"
    result = None
    try:
        global _compile_error
        if _compile_error is not None:
            raise _compile_error
        msg = ""
        import numpy as np
        result = obj.predict(np.array([CRIM,ZN,INDUS,CHAS,NOX,RM,AGE,DIS,RAD,TAX,PTRATIO,B,LSTAT]).reshape((1, -1)))
        if result.size == 1:
            result = np.asscalar(result)
    except Exception as e:
        msg = str(e)
        if result is None:
            result = tuple(None for i in range(1))
    if isinstance(result, tuple):
        return tuple(x for x in list(result) + [msg])
    else: 
        return result, msg
